window.bookSummaryJSON = "<p>With Unity formed, Gunnar feels like he's created a family like he's never had before. All that's left is to grow in strength, continue building in Edgewood, and maybe earn a little affection from Princess Adeelee. Nothing can tear him away from his friends and newly founded guild.</p> <p>Or can it?</p> <p>Gunnar still has a lot to learn about his massive, new world. There are eyes and ears everywhere. Deception can come when you least expect it, and in Eden's Gate, sometimes you can lose control of your own fate.</p> <p>And Rachel? Maybe she's still out there...somewhere.</p>"; 
